import { createStore } from 'redux';
import { rootReducer ,productReducer } from './reducers';

const store = createStore(
  rootReducer,
  productReducer,
  window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__() // for browser dev tools
);

export default store;
